// @updateURL https://update.greasyfork.org/scripts/429989/%E9%BC%A0%E6%A0%87%E7%82%B9%E5%87%BB%E7%89%B9%E6%95%88.meta.js
// ==/UserScript==

(function() {

    function animate(obj, json, interval, sp, fn) {
        clearInterval(obj.timer);
        //var k = 0;
        //var j = 0;
        function getStyle(obj, arr) {
            if(obj.currentStyle){
                return obj.currentStyle[arr];   //针对ie
            } else {
                return document.defaultView.getComputedStyle(obj, null)[arr];
            }
        }
        obj.timer = setInterval(function(){
            //j ++;
            var flag = true;
            for(var arr in json) {
                var icur = 0;
                //k++;
                if(arr == "opacity") {
                    icur = Math.round(parseFloat(getStyle(obj, arr))*100);
                } else {
                    icur = parseInt(getStyle(obj, arr));
                }
                var speed = (json[arr] - icur) * sp;
                speed = speed > 0 ? Math.ceil(speed): Math.floor(speed);
                if(icur != json[arr]){
                    flag = false;
                }
                if(arr == "opacity"){
                    obj.style.filter = "alpha(opacity : '+(icur + speed)+' )";
                    obj.style.opacity = (icur + speed)/100;
                }else {
                    obj.style[arr] = icur + speed + "px";
                }
                //console.log("," + arr +":"+ flag);
            }

            if(flag){
                clearInterval(obj.timer);
                //console.log(j + ":" + flag);
                //console.log("k = " + k);
                //console.log("j = " + j);
                //console.log("DONE");
                if(fn){
                    fn();
                }
            }
        },interval);
    }

    document.onmousedown=function(e){

        //随机选择文字
            var a = new Array(
                "乐观", "❤", "积极", "向上", "自由", "正能量", "(*^▽^*)", "元气满满", "开心", "快乐",
                 "善良", "暴富", "暴瘦", "❤","富强", "民主", "文明", "和谐", "自由", "平等",
                 "公正" ,"法治", "爱国", "敬业", "诚信", "友善","心血来潮", "❤", "❤", "❤",
                


                 );
            var a_idx = Math.floor((Math.random() * a.length));
            // 随机产生文字颜色
            var color1 = Math.floor((Math.random() * 255));
            var color2 = Math.floor((Math.random() * 255));
            var color3 = Math.floor((Math.random() * 255));
            a_idx = (a_idx + 1) % a.length;
            var x = e.pageX,
                y = e.pageY;



        var text = document.createElement("span");
        text.innerHTML = a[a_idx];
        text.style.zIndex=9999999999999;
        text.style.top= y - 20+'px';
        text.style.left= x+'px';
        text.style.position="absolute";
        text.style.fontFamily="宋体";
        text.style.fontSize= Math.floor((Math.random() * 15)+5)+'px';
        text.style.fontWeight= "bold";
        text.style.color= "rgb("+color1+","+color2+","+color3+")";
        text.style.userSelect="none";


        document.body.appendChild(text)



        let closeTime = Math.floor((Math.random() * 300)+800);

        animate(text,
                {
                   "top": y - 350,
                   "opacity": 0,
                   "font-size":70
                },11, 0.01, function(){

               document.body.removeChild(text);
            });





    }

   

})();